          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "Wait, what? Einstein‚Äôs tram thing made no sense. Time wasn‚Äôt slowing down, the system we used to measure it did. And that doesn‚Äôt have anything to do with motionbut how far away you are from the dang thing. If he took the tram back, I swear the clock would have ‚Äòcaught back up‚Äô to his time.",
