          "kind": "youtube#comment",
          "etag": "CZ45X2X8DFn1AavLWXKbrjg1UfE",
          "id": "Ugx89HZmBSYPrxoHjZ54AaABAg",
          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "This does not make sense \nTime does not slow down \nEinstein looking at the clock tower would still see the second hands moving at the same speed BUT he would have travelled the distance of the speed of light in that one second time interval. The time would still be exactly the same. I do not agree with this thought experiment for this very simple reason. \nBy saying that the second hand has stopped is wrong because If travelling at the speed of light he would have travelled the distance of light in that one second and when he looks back the second hand would have moved. For him to say the second hand has not moved means he is somehow looking back at a speed slower than the speed of light over the same distance and that is impossible. By this I mean he is stretching the speed of light artificially by treating it at a different speed over the same distance and that simply doesn‚Äôt work. It is either the speed of light or it is not. If Einstein was travelling at a speed less than the speed of light time would still pass the same but he would not have travelled as far in the same one second interval.",
            "textOriginal": "This does not make sense \nTime does not slow down \nEinstein looking at the clock tower would still see the second hands moving at the same speed BUT he would have travelled the distance of the speed of light in that one second time interval. The time would still be exactly the same. I do not agree with this thought experiment for this very simple reason. \nBy saying that the second hand has stopped is wrong because If travelling at the speed of light he would have travelled the distance of light in that one second and when he looks back the second hand would have moved. For him to say the second hand has not moved means he is somehow looking back at a speed slower than the speed of light over the same distance and that is impossible. By this I mean he is stretching the speed of light artificially by treating it at a different speed over the same distance and that simply doesn‚Äôt work. It is either the speed of light or it is not. If Einstein was travelling at a speed less than the speed of light time would still pass the same but he would not have travelled as far in the same one second interval.",
