          "etag": "-YU1wrGh4i9GVh6SUgD9LSEuIpQ",
          "id": "UgzNbsB90CysLA_cvKd4AaABAg",
          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "Can you imagine in the future, sending teams of scientists and engineers to where time dilation was so small (almost 0 gravitational influence) that their stay would last only an hour or so until they grew very oldbut their knowledge and research that they perceived as years would remain, so they would report back to earth years of knowledge while something like a month had elapsed on Earth?",
