      "etag": "qgXU1xPhpqrf2w6tBpLefndVJnM",
      "id": "Ugz0188wNgYvcQjt8LR4AaABAg",
      "snippet": {
        "videoId": "yuD34tEpRFw",
        "topLevelComment": {
          "kind": "youtube#comment",
          "etag": "-oYcUlu3z5Qc2aUXEdywMtoZfsI",
          "id": "Ugz0188wNgYvcQjt8LR4AaABAg",
          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "Ok so here's my question. If a star is 4 light-years away, and I'm traveling at the speed of light towards that star, for me wouldn't it feel like 4 years still since it takes that long for the light to reach it? Why would it feel much shorter for me if it's actually 4 years? Also a free question: Do you all believe that time is a real object that is inner twined with space, or just a concept we use to measure our world like other things?",
