          "kind": "youtube#comment",
          "etag": "Hhy38r-HoOgClPufkFo-bgV-XRA",
          "id": "UgyGgo0R06wzaMVS4u54AaABAg",
          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "So every science geek ..what if I travel in the speed of light for 5 seconds(3 lacs√ó 5 km) into the space then come back to the earth in another 5 seconds....I have taken my clock to space then back to earth with me ..it costs 10 seconds? Is it costs same time on earth too????\n\nPlease reply,",
            "textOriginal": "So every science geek ..what if I travel in the speed of light for 5 seconds(3 lacs√ó 5 km) into the space then come back to the earth in another 5 seconds....I have taken my clock to space then back to earth with me ..it costs 10 seconds? Is it costs same time on earth too????\n\nPlease reply,",
