    {
      "kind": "youtube#commentThread",
      "etag": "h7gehurzwLJdahus2y_DRE-q338",
      "id": "UgzQ_2ix7VtVfB9ftOB4AaABAg",
      "snippet": {
        "videoId": "yuD34tEpRFw",
        "topLevelComment": {
          "kind": "youtube#comment",
          "etag": "Xay2H7aZVj-4qtwmoJ7yRIeG0A8",
          "id": "UgzQ_2ix7VtVfB9ftOB4AaABAg",
          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "Time, is defined as a momentum of elapsed distance. Their can be no time without a defined distance of movement. Our value for time is defined by the distance Earth travels on its orbit around the Sun. We call this period a year and all other derivatives of time is defined by either a divisor or a multiplier of this period. All of our values of time are based on the numbers we assign to this perio. The thing that science does not recognize is that our values are unique exclusively to this platform we call Earth. Einstein explains this partially with his postulate of time dilation but jhe links it to space which is like comparing apples to oranges. Their is no correlation with time and space. Time and distance maybe but not time and space because space is an unidentifiable entity. It can only be constructed in the conscious mind. By this I mean, we define the lenght of a mile or a kilometer out of whole cloth.",
            "textOriginal": "Time, is defined as a momentum of elapsed distance. Their can be no time without a defined distance of movement. Our value for time is defined by the distance Earth travels on its orbit around the Sun. We call this period a year and all other derivatives of time is defined by either a divisor or a multiplier of this period. All of our values of time are based on the numbers we assign to this perio. The thing that science does not recognize is that our values are unique exclusively to this platform we call Earth. Einstein explains this partially with his postulate of time dilation but jhe links it to space which is like comparing apples to oranges. Their is no correlation with time and space. Time and distance maybe but not time and space because space is an unidentifiable entity. It can only be constructed in the conscious mind. By this I mean, we define the lenght of a mile or a kilometer out of whole cloth.",
            "authorDisplayName": "Norman Thornton",
            "authorProfileImageUrl": "https://yt3.ggpht.com/ytc/AMLnZu8p5woPxiFrjU-gAA1dPwxXZLl8WIMn09-v4g=s48-c-k-c0x00ffffff-no-rj",
