          "id": "UgyE1_gbLdx8kBUy_VB4AaABAg",
          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "Einstein's relativity has a major (absolute) flaw: the speed of light cannot be constant to all observers. In this case, what Einstein observes as time stopping in fact is just the visualization of the clock stopping. He can see the clock stops because he is constantly traveling at the speed in which light propagatesbut this does not mean time itself stopped, it's just how the clock's look that stopped.\nFollowing that logic, if he can travel faster than the speed of light, he can start catching the lights that traveled away from the clock in the past, and he can start watching the clock going backward (the past). Yes, he can watch itbut that is, he's not in the past nor time has changed its pace. Once he stops, the movie he's watching will start fast forwarding back to the real time.\nAbsolute time is true, and most scientists won't tell you that because Einstein relativity is so elegant and mind blowing (none of these 2 adjectives necessarily mean \"correct\") that it has become like a religion to them. \nI believe (maybe I'm wrong) that time and space are not related, they co-exist and use each other as reference frame or benchmark for comparison or measurementbut do not interact with each other in any substantial way (in other words: you cannot bend time with space or bend space with time).",
            "textOriginal": "Einstein's relativity has a major (absolute) flaw: the speed of light cannot be constant to all observers. In this case, what Einstein observes as time stopping in fact is just the visualization of the clock stopping. He can see the clock stops because he is constantly traveling at the speed in which light propagatesbut this does not mean time itself stopped, it's just how the clock's look that stopped.\nFollowing that logic, if he can travel faster than the speed of light, he can start catching the lights that traveled away from the clock in the past, and he can start watching the clock going backward (the past). Yes, he can watch itbut that is, he's not in the past nor time has changed its pace. Once he stops, the movie he's watching will start fast forwarding back to the real time.\nAbsolute time is true, and most scientists won't tell you that because Einstein relativity is so elegant and mind blowing (none of these 2 adjectives necessarily mean \"correct\") that it has become like a religion to them. \nI believe (maybe I'm wrong) that time and space are not related, they co-exist and use each other as reference frame or benchmark for comparison or measurementbut do not interact with each other in any substantial way (in other words: you cannot bend time with space or bend space with time).",
